          <TextInput
            style={styles.textinput}
            placeholder="อายุ"
          />
        </p>
        <p>
          <h1>อาชีพ</h1>
          <TextInput
            style={styles.textinput}
            placeholder="อาชีพ"
          />
        </p>
      </div>
    </div >
  );
}

const styles = StyleSheet.create({
  textinput: {
    fontFamily: 'Iconic',
